import React ,{useState,useEffect} from "react"

function Post() {

  let [dataName,setDataName] = useState([]);
  let [dataPrice,setDataPrice] = useState([]);
  let [dataAmount,setDataAmount] = useState([]);
 function setName(event){
      setDataName(event.target.value)
      console.log(dataName);
 };
 function setPrice(event){
    setDataPrice(event.target.value)
    console.log(dataName);
};
function setAmount(event){
    setDataAmount(event.target.value)
    console.log(dataName);
}
  return(
       
       <div>
        <div>post</div>
        <form>
            <label>Name:</label>
            <input type="text"  
                   value={dataName}
                   onChange={setName} />
            
            <table>price:</table>
            <input type="text" 
                   value={dataPrice}
                   onChange={setPrice} />
            
            <table>amount:</table>
            <input type="numble"
                   value={dataAmount}
                   onChange={setAmount} />
            
            <table>img:</table>
            <input type="file" />
            
           
            <button>Thêm mặt hàng</button>
</form>
       </div>
    )
}

export default Post
